import React from 'react'
import './heroStyle.css'

export default function Hero(props) {
  return (
    <div className='hero'>
      <h1>{props.title}</h1>
      {content.map((item) => (
        <div key={item.id} className='image-sec'>
          <img
            src={`https://image.tmdb.org/t/p/original/${item?.backdrop_path}`}
            alt={item?.title}
          />
        </div>
      ))}
    </div>
  )
}
